package com.wzt.sun.infanteducation.bean;

public class Recipe {
	private String re_af;
	private String re_afdown;
	private String re_am;
	private String re_amup;
	private int re_authr;
	private String re_date;
	private int re_id;
	private String re_mr;
	private String re_ni;
	private String re_uploaddate;
	private String re_week;
	public Recipe() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getRe_af() {
		return re_af;
	}
	public void setRe_af(String re_af) {
		this.re_af = re_af;
	}
	public String getRe_afdown() {
		return re_afdown;
	}
	public void setRe_afdown(String re_afdown) {
		this.re_afdown = re_afdown;
	}
	public String getRe_am() {
		return re_am;
	}
	public void setRe_am(String re_am) {
		this.re_am = re_am;
	}
	public String getRe_amup() {
		return re_amup;
	}
	public void setRe_amup(String re_amup) {
		this.re_amup = re_amup;
	}
	public int getRe_authr() {
		return re_authr;
	}
	public void setRe_authr(int re_authr) {
		this.re_authr = re_authr;
	}
	public String getRe_date() {
		return re_date;
	}
	public void setRe_date(String re_date) {
		this.re_date = re_date;
	}
	public int getRe_id() {
		return re_id;
	}
	public void setRe_id(int re_id) {
		this.re_id = re_id;
	}
	public String getRe_mr() {
		return re_mr;
	}
	public void setRe_mr(String re_mr) {
		this.re_mr = re_mr;
	}
	public String getRe_ni() {
		return re_ni;
	}
	public void setRe_ni(String re_ni) {
		this.re_ni = re_ni;
	}
	public String getRe_uploaddate() {
		return re_uploaddate;
	}
	public void setRe_uploaddate(String re_uploaddate) {
		this.re_uploaddate = re_uploaddate;
	}
	public String getRe_week() {
		return re_week;
	}
	public void setRe_week(String re_week) {
		this.re_week = re_week;
	}
	@Override
	public String toString() {
		return "Recipe [re_af=" + re_af + ", re_afdown=" + re_afdown + ", re_am=" + re_am + ", re_amup=" + re_amup
				+ ", re_authr=" + re_authr + ", re_date=" + re_date + ", re_id=" + re_id + ", re_mr=" + re_mr
				+ ", re_ni=" + re_ni + ", re_uploaddate=" + re_uploaddate + ", re_week=" + re_week + "]";
	}
	
	

}
